let TabHeaderPositionInstance = null;
module.exports = class tabHeaderPosition {

    constructor() {
        if (!TabHeaderPositionInstance) {
            TabHeaderPositionInstance = this;
            //set all other default values

            this.displayAs = 'Tab Header Position';
            this.value = 'headerPosition'
            this.type = 'TOGGLE';
            this.labels = {'true-label': 'Above', 'false-label': 'Below'}
            this.values = {'true-value':'', 'false-value': 'below'}
        }
        return TabHeaderPositionInstance;
    }
}